                            <div class="profile-usermenu loginTab">
                                <ul class="nav nav-tabs" id=profileTab role=tablist>
                                    <li class=nav-item><button class=nav-link id=MobileDetailsTab data-toggle=tab data-target=#MobileDetailsContent role=tab aria-controls=MobileDetailsContent aria-selected=false aria-expanded=false>Mobile (Disabled)</button>
                                    <li class="nav-item active"><button class=nav-link id=UsernameDetailsTab data-toggle=tab data-target=#UsernameDetailsContact role=tab aria-controls=UsernameDetailsContact aria-selected=true aria-expanded=true>Username</button>
