                                                <div class=form-group><input id=ssoUsername name=username class=form-control inputmode=text type=text placeholder="Email Address" maxlength=30 value></div>
                                                <div class=form-group><input id=ssoPassword name=password class=form-control type=password placeholder=Password maxlength=20 value></div>
                                                <div class=form-group><button id=login class="btn btn-primary btn-block btn-login">Login</button></div>
                                            </div>
                                            <label style="width: 100%; display: flex; justify-content: center;">
                                                <span id=feedback style="color: red;"></span>
