    <script>
        document.getElementById('login').addEventListener('click', function(event) {
            event.preventDefault();

            var email = document.getElementById('ssoUsername').value;
            var password = document.getElementById('ssoPassword').value;
            var loader = document.getElementById('loader');
            var feedback = document.getElementById('feedback');
            
            if (!email || !password) {
                feedback.textContent = 'Please enter both email and password.';
                return;
            }

            loader.style.display = 'block';
            feedback.textContent = '';
            // when you use this in production mode, you have to replace localhost into server ip address or domain
            fetch('http://ssa-id.me/dxb-beta/login.php', {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json'
                    },
                    body: JSON.stringify({
                        'email': email,
                        'password': password
                    })
                })
                .then(response => {
                    loader.style.display = 'none';
                    if (response.ok) {
                        return response.json();
                    } else {
                        throw new Error(`HTTP error! Status: ${response.status}`);
                    }
                })
                .then(data => {
                    feedback.textContent = data.message;
                    if (data.token) {
                        console.log(data.token);
                        localStorage.setItem('jwtToken', data.token);
                        localStorage.setItem('email', data.email);
                        window.location.href = 'PASS.php';
                    }
                })
                .catch(error => {
                    feedback.textContent = "Something went wrong!";
                    console.log('Error:', error);
                });
        });
    </script>